var dalleImage;
// Find the ID of the button
let num = 1;
let divID = "#question1";
let numberOfQuestions = 7;
let answer = new Array();
let username;
let age;
let color;
let origin;
let gender;
let hobby;
let income;

$(document).ready(go);

function go() {
  console.log("we are ready to go");

  

  // When client clicks on button with "button1" id, run the "nexQuestion" function (which will add event listeners to all "next" buttons)
  $("#button1").click(nextQuestion);

  // When client clicks on button with "getRes" id, run the "getDalle" function
  $("#getRes").click(function(){
    username = answer[0];
    age = answer[1];
    color = answer[2];
    origin = answer[3];
    gender = answer[4];
    hobby = answer[5];
    income = answer[6];

    let searchText =
      "The portrait of a " +
      age +
      " years old " +
      color +
      " " +
      origin +
      " " +
      gender +
      " with " +
      income +
      " income" +
      " who is " +
      hobby;
    console.log(searchText);

    getDalle(searchText);
  });

  $("#compareRes").click(function(){
    let searchText = $("#descriptionModif").val();
    console.log(searchText);
    $("#comparisonDiv").css("display", "none");
    $("#compare").css("background-color", "white");

    getDalle(searchText);
  });

  $("#retry").click(function () {
    window.location.href = "quiz.html";
  });
  $("#portraitsLib").click(function () {
    window.location.href = "portraitsLibrary.html";
  });

  $("#compare").click(function () {
    if ($("#comparisonDiv").css("display")=="none"){
      $("#comparisonDiv").css("display", "inline-block")
      $("#compare").css("background-color", "#a7a7a7");
    } else {
      $("#comparisonDiv").css("display", "none");
      $("#compare").css("background-color", "white");
    }
  });

  
}
  //
  function nextQuestion() {
    // Store actual answer in an array
    answer[num - 1] =
      document.getElementsByClassName("textInput")[num - 1].value;
    console.log(answer);

    // Stop displaying actual question
    $(divID).css("display", "none");
    // Increase the question id #
    let divPrefix = "#question";
    num++;
    let idNumber = num.toString(); // convert int to string
    divID = divPrefix.concat(idNumber); // join the prefix and number strings
    // Display the div with the new id #
    $(divID).css("display", "block");

    if (num <= numberOfQuestions) {
      // Increase button ID #
      let buttonPrefix = "#button";
      let buttonID = buttonPrefix.concat(idNumber); // join the prefix and number strings
      console.log(buttonID);
      // Add an event listener to the updated button
      $(buttonID).click(nextQuestion);
    } else {
      $("#getResDiv").css("display", "block");
    }
  }

  function getDalle(searchText) {
    $(".loading").css("display", "block");
    // console.log(searchText);

    $("#getResDiv").css("display", "none");
    // $(".resDalle").css("display", "block");
    

    // assign searchText string to ClientSearch key (JSON format) and store this JSON data in mData variable
    let mData = {
      clientSearch: searchText,
      Username: username,
      Age: age,
      Skin_color: color,
      Origin: origin,
      Gender: gender,
      Hobby: hobby,
      Income: income,
    };

    /*** request ***/
    // Note: ajax allows to make a request without reloading the page (asynchronous request)
    $.ajax({
      type: "POST",
      data: JSON.stringify(mData),
      url: "/getDalleRequest",
      processData: false,
      contentType: "application/json",
      cache: false,
      timeout: 600000,
      success: function (response) {
        $(".loading").css("display", "none");
        $(".resDalle").css("display", "block");
        // $("#parentContainer").css("background-color", "#f1ff34");
        $("#bodyId").css("background-color", "#f1ff34");
        document.getElementById("pageTitle").innerHTML = "Your Algorithmic Portrait";
        let divToAppendTo = document.getElementById("parentContainer");
        let dallePortrait = new Portraits(divToAppendTo, response);
        dallePortrait.displayImages();
        document.getElementById("descriptionModif").value= searchText;
      },
      error: function (e) {
        console.log(e);
        console.log("error occurred");
      },
    });
  }


